import * as React from "react";
import { useState } from "react";
import { Fragment } from "react";
import { Menu, Transition } from "@headlessui/react";
import { ChevronDownIcon } from "@heroicons/react/20/solid";
export interface Props {
  Data: {
    id: number;
    name: string;
    latitude: string;
    longitude: string;
    population: number;
    region: string;
  }[];
}

export function Input(props: Props) {
  const [writtenCity, setwrittenCity] = React.useState<string>("");
  return (
    <section className="bg-mint ">
      <div className="relative  inline-block text-left w-full font-light">
        <div className="bg-mint flex flex-row">
          <input
            placeholder="ادخل اسم المحافظة"
            onChange={(event) => setwrittenCity(event.target.value)}
            className={`inline-flex justify-between text-right  w-full justify-center rounded-md border  bordefocus:ring-2 p-2 items-center border-[#7E7477] text-darkGreen text-xs font-light`}
          />
          <ChevronDownIcon
            className={`-mr-1 h-5 w-5 font-light absolute left-2 mt-2 `}
            aria-hidden="true"
          />
        </div>
      </div>

      <div>
        <div
          className="bg-mint absolute right-0 z-10 mt-2 w-2/3 origin-top-right rounded-md bg-[#fff] shadow-lg ring-1 ring-[#79747E] text-right ring-opacity-5 focus:outline-none`}
"
        >
          {props.Data.map((city) =>
            writtenCity === "" ? (
              writtenCity
            ) : (
              <div>
                {city.name.toLowerCase().includes(writtenCity.toLowerCase())
                  ? city.name
                  : null}
              </div>
            )
          )}
        </div>
      </div>
    </section>
  );
}
